import React from 'react'
import { LoadScript, GoogleMap, Marker, InfoWindow, Polyline } from '@react-google-maps/api';
export default function Testmap({totalLine}) {
    //console.log(totalLine);

    const center = {
        lat : 37.666169,
        lng  : 128.710769
    };
    const options300 = {
        strokeColor:'#4a148c',
        strokeOpacity: 0.75,
        strokeWeight: 6,
    };
    const options200 = {
        strokeColor:'#1565c0',
        strokeOpacity: 0.75,
        strokeWeight: 4,
    };
    const options100 = {
        strokeColor:'#f57f17',
        strokeOpacity: 0.75,
        strokeWeight: 2,
    };
    const latLng = (value)=>{
        totalLine.map(value=>{return {line : value.line, bw : value.bw}})
        if(value.line === 1 && value.bw === 300){
            return (
                <Polyline
                    path={value}
                    options={options300}
                />
            )
        }
    }
    console.log(latLng);
    return (
        <div>
            <LoadScript googleMapsApiKey="AIzaSyDevvetng60XedeOqk-qW9TF-XBNQsyxdE">
                <GoogleMap
                    mapContainerStyle={{
                        width : '1900px',
                        height : '700px',
                        margin : '20px'
                    }}
                    center={center}
                    zoom={13}
                >
                    {
                        totalLine.map((value)=>{
                            //console.log(value);
                            return(
                                <Marker 
                                    position={value}
                                />
                            );
                        })
                    }
                    {
                        totalLine.map(value=>{
                            console.log(value);
                            if(value.bw === 300&& value.line === 1){
                                latLng();
                            }else if(value.bw === 200){
                                return(
                                    <Polyline
                                        path={value}
                                        options={options200}
                                    />
                                )
                            }else if(value.bw === 100){
                                console.log(value);
                            }
                        })
                    }
                </GoogleMap>
            </LoadScript>
        </div>
    )
}
